import Nav from 'react-bootstrap/Navbar';
import img from '../Images/navlogo.jpg';
import { Container } from 'react-bootstrap';
import moduleName from '@fortawesome/fontawesome'

function Navbar(){

    return(
        <>
         {[false, 'sm', 'md', 'lg', 'xl', 'xxl'].map((expand) => (
           <Nav key={expand} expand={expand} className='bg-bg-primery mb-3' fixed='top'>
            <Container fluid>
                <Nav.Brand aria-expanded={true}> 
                    <img src={img} alt='navlogo' style={{height:"15px", width:"15px"}}/>
                </Nav.Brand>
                <Nav.Toggle>
                       
                </Nav.Toggle>
            </Container>
           </Nav>
        ))}
        </>
    )
}

export default Navbar;
